import React from 'react';
import { Field, reduxForm } from 'redux-form'

let Vin = props => {
    const { handleSubmit } = props
    return (
        <Form onSubmit={handleSubmit}>
            <Field 
                type="text"
                maxLength="17"
                name="vin"
                component="input"
                placeholder="Enter your 17 digit Vin"
                className="offer-input" 
            />
        </Form>

    )
}

export default Vin = reduxForm({
    form: 'vin'
})(Vin);
